(545, 1, 0, 0, 0, 'Very tippy and the lift is completely bent and gets jammed easily', 3, 0, 62, '', 0, 1, 275, 0, 5511, 0, 0, 60, 0, 0),
(546, 1, 0, 0, 0, 'Intake can only pick up cubes when they are aligned perfectly. Alliance played 1-cube force, 3-cube boost, and levitate power ups.', 0, 0, 62, '', 0, 0, 324, 3, 4935, 0, 0, 37, 4, 0),
(547, 1, 1, 0, 0, 'Decent vault and switch bot, not very efficient due to inaccurate intake which only takes in cubes at a certain orientation.', 0, 0, 62, '', 0, 0, 275, 2, 6932, 0, 0, 70, 2, 0),
(548, 1, 0, 0, 0, 'Relatively fast at switch but sometimes fails to grab cubes the first time. Fast and reliable vault bot.', 0, 0, 63, '', 0, 0, 467, 2, 587, 0, 0, 53, 5, 0),
(549, 1, 0, 0, 1, 'Prioritized scale. Alliance played all three power ups at 3-cube power.', 0, 0, 63, '', 0, 4, 502, 0, 3196, 1, 0, 37, 0, 0),
