(551, 1, 0, 4, 0, 'Robot had a lot of trouble lifting the cube up and dropped it a few times. it deployed a ramp and climbed, but was not able to lift up another robot with it.', 0, 1, 63, '', 0, 0, 267, 0, 900, 1, 0, 68, 0, 0),
(552, 1, 0, 1, 0, 'Tried a two cube scale auto and missed the second cube. Missed six cubes on the scale in teleop and one on the opposing switch.', 1, 0, 63, '', 0, 0, 502, 0, 6502, 0, 0, 10, 1, 0),
(553, 1, 2, 0, 0, 'Very underwhelming performance from such a high team, they stopped for the first 20 seconds of teleop and it wasnâ€™t apparent how they were attempting to contribute to the team, very poor switch and vault placement during teleop, no defense played on or against them.', 0, 0, 63, '', 0, 0, 327, 0, 1533, 0, 0, 70, 3, 0),
(554, 1, 0, 0, 0, 'Auto drives barely over the line and into the wall. Dropped the cube on muiltille occasions. Only can do the switch.', 5, 0, 64, '', 0, 0, 326, 0, 6888, 0, 0, 10, 0, 0),
(555, 1, 0, 0, 0, 'Targeted mainly the scale, missed a couple of times. Missed the switch in autonomous', 0, 0, 64, '', 0, 4, 205, 0, 2682, 0, 0, 68, 0, 1),
(556, 1, 1, 0, 1, 'Prioritized scale. Good at placing cubes precisely, & tall enough to place them on top of other cubes.', 0, 0, 64, 'Used one of those latch things to hook the bar.', 0, 5, 326, 0, 3459, 1, 0, 37, 0, 1),
(557, 1, 0, 0, 0, 'Robot driving is kind of questionable. They had a hard time putting cube in vault', 0, 0, 64, 'Climbing is very bad. Robot is lifted by side', 0, 0, 205, 3, 3229, 1, 0, 60, 2, 0),
(558, 1, 0, 0, 0, 'Decent scale and switch bot, cube placement needs to be improved. Very unnecessary could caused by reckless driving and passing through null, attributed to the loss of their match.', 2, 0, 64, '', 0, 3, 205, 0, 6500, 0, 0, 70, 0, 1),
(559, 1, 1, 0, 0, 'The robot kept overshooting the scale but it did get a lot of cubes in the vault which pulled the blue team up. It also got a cube into autonomous but it struggled to work with the other robots.', 0, 0, 64, '', 0, 1, 326, 0, 4828, 0, 0, 63, 4, 0);
